import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
} from '@mui/material';
import {
  Security,
  CloudUpload,
  Rule,
  Scanner,
} from '@mui/icons-material';
import { useNavigate, useLocation } from 'react-router-dom';

const Navbar: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: 'IaC Scanner', path: '/scanner', icon: <Scanner />, roman: 'I' },
    { label: 'Log Analysis', path: '/logs', icon: <CloudUpload />, roman: 'II' },
    { label: 'Rule Management', path: '/rules', icon: <Rule />, roman: 'III' },
  ];

  return (
    <AppBar 
      position="static" 
      elevation={0}
      sx={{
        backgroundColor: '#141414',
        borderBottom: '2px solid #D4AF37',
        position: 'relative',
        '&::after': {
          content: '""',
          position: 'absolute',
          bottom: -2,
          left: '50%',
          transform: 'translateX(-50%)',
          width: 100,
          height: 2,
          background: 'linear-gradient(90deg, transparent, #D4AF37, transparent)',
        }
      }}
    >
      <Toolbar sx={{ minHeight: 80, px: 4 }}>
        {/* Art Deco Logo */}
        <Box 
          sx={{ 
            display: 'flex', 
            alignItems: 'center', 
            mr: 6, 
            cursor: 'pointer',
            position: 'relative',
            '&:hover': {
              '& .logo-icon': {
                transform: 'rotate(45deg)',
                boxShadow: '0 0 15px rgba(212, 175, 55, 0.4)',
              },
              '& .logo-text': {
                color: '#D4AF37',
              }
            },
            transition: 'all 0.3s ease',
          }}
          onClick={() => navigate('/dashboard')}
        >
          {/* Diamond Icon Container */}
          <Box
            className="logo-icon"
            sx={{
              width: 48,
              height: 48,
              backgroundColor: '#D4AF37',
              transform: 'rotate(45deg)',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              mr: 2,
              transition: 'all 0.3s ease',
              position: 'relative',
              '&::before': {
                content: '""',
                position: 'absolute',
                top: 2,
                left: 2,
                right: 2,
                bottom: 2,
                border: '1px solid #0A0A0A',
              }
            }}
          >
            <Security 
              sx={{ 
                fontSize: 24, 
                color: '#0A0A0A',
                transform: 'rotate(-45deg)',
              }} 
            />
          </Box>

          <Box>
            <Typography 
              variant="h5" 
              component="div" 
              className="logo-text"
              sx={{ 
                fontFamily: '"Marcellus", serif',
                textTransform: 'uppercase',
                letterSpacing: '0.15em',
                color: '#F2F0E4',
                transition: 'color 0.3s ease',
                lineHeight: 1,
              }}
            >
              Securon
            </Typography>
            <Typography 
              variant="caption" 
              sx={{ 
                color: '#888888',
                textTransform: 'uppercase',
                letterSpacing: '0.2em',
                fontSize: '0.7rem',
              }}
            >
              Platform
            </Typography>
          </Box>
        </Box>

        {/* Vertical Divider */}
        <Box
          sx={{
            width: 1,
            height: 40,
            backgroundColor: 'rgba(212, 175, 55, 0.3)',
            mr: 4,
          }}
        />

        {/* Navigation Items */}
        <Box sx={{ flexGrow: 1, display: 'flex', gap: 0 }}>
          {navItems.map((item, index) => (
            <Box key={item.path} sx={{ position: 'relative' }}>
              <Button
                onClick={() => navigate(item.path)}
                sx={{
                  color: location.pathname === item.path ? '#D4AF37' : '#F2F0E4',
                  backgroundColor: 'transparent',
                  border: location.pathname === item.path ? '1px solid #D4AF37' : '1px solid transparent',
                  borderRadius: 0,
                  px: 4,
                  py: 2,
                  minHeight: 56,
                  textTransform: 'uppercase',
                  letterSpacing: '0.1em',
                  fontWeight: 500,
                  position: 'relative',
                  transition: 'all 0.3s ease',
                  '&:hover': {
                    backgroundColor: 'rgba(212, 175, 55, 0.1)',
                    borderColor: '#D4AF37',
                    color: '#D4AF37',
                    boxShadow: '0 0 10px rgba(212, 175, 55, 0.2)',
                  },
                  '&::before': {
                    content: `"${item.roman}"`,
                    position: 'absolute',
                    top: 4,
                    right: 8,
                    fontSize: '0.7rem',
                    fontFamily: '"Marcellus", serif',
                    color: location.pathname === item.path ? '#D4AF37' : 'rgba(212, 175, 55, 0.5)',
                    transition: 'color 0.3s ease',
                  }
                }}
              >
                <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 0.5 }}>
                  {/* Diamond Icon Container */}
                  <Box
                    sx={{
                      width: 24,
                      height: 24,
                      transform: 'rotate(45deg)',
                      backgroundColor: location.pathname === item.path ? '#D4AF37' : 'transparent',
                      border: `1px solid ${location.pathname === item.path ? '#D4AF37' : 'rgba(212, 175, 55, 0.5)'}`,
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center',
                      transition: 'all 0.3s ease',
                    }}
                  >
                    {React.cloneElement(item.icon, {
                      sx: { 
                        fontSize: 14, 
                        transform: 'rotate(-45deg)',
                        color: location.pathname === item.path ? '#0A0A0A' : 'currentColor',
                      }
                    })}
                  </Box>
                  <Typography variant="caption" sx={{ fontSize: '0.75rem', mt: 0.5 }}>
                    {item.label}
                  </Typography>
                </Box>
              </Button>

              {/* Vertical Divider between nav items */}
              {index < navItems.length - 1 && (
                <Box
                  sx={{
                    position: 'absolute',
                    right: 0,
                    top: '50%',
                    transform: 'translateY(-50%)',
                    width: 1,
                    height: 30,
                    backgroundColor: 'rgba(212, 175, 55, 0.2)',
                  }}
                />
              )}
            </Box>
          ))}
        </Box>

        {/* Decorative Corner Elements */}
        <Box
          sx={{
            position: 'absolute',
            top: 8,
            right: 8,
            width: 20,
            height: 20,
            borderTop: '2px solid rgba(212, 175, 55, 0.3)',
            borderRight: '2px solid rgba(212, 175, 55, 0.3)',
          }}
        />
        <Box
          sx={{
            position: 'absolute',
            bottom: 8,
            left: 8,
            width: 20,
            height: 20,
            borderBottom: '2px solid rgba(212, 175, 55, 0.3)',
            borderLeft: '2px solid rgba(212, 175, 55, 0.3)',
          }}
        />
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
